import Header from "../components/Header"
import ImgMarmore from '../assets/images/marmore.png';

function Contato(){
    return(
        <div>
            <Header/>
            <div className="container-contato">
            <h1>Contato</h1>
            <img src={ImgMarmore} alt="img-fundo-marmore"></img>
            </div>
        </div>  
    )
}

export default Contato
